import './App.css';
import principalImg from './assets/cellphone.png';
import voxsweetLogo from './assets/Logo.png';
import { Signup } from './components/Signup'


function App() {
  return (
    <div className="container">
      <div class="row">
        <div className="col-4">
          <img className="img-fluid principal-img" src={principalImg} alt=""/>
        </div>

        <div className="col-6">
          <img className="img-fluid" src={voxsweetLogo} alt=""/>
            <Signup />
        </div>

      </div>
    </div>
  );
}

export default App;
